import React, { Component} from 'react';
import CardList from './CardList'
import SearchBox from './SearchBox'
import { robots } from './robots';

class App extends Component{
    constructor() { 
        this.state = {
            robots: robots,
            searchfield: ''
        }
    }
    render() {
        return (
            <fragement className='tc'>
                <h1>Robofriends</h1>
                <SearchBox />
                <CardList robots={robots}/>
            </fragement>
        );
    }

}

export default App;
